import { createUseStyles } from "react-jss";

const drawerWidth = 240;


const useStyles = createUseStyles({
    root: {
        display: 'flex',
    },
    drawer: {
            width: drawerWidth,
            flexShrink: 0,
    },
    appBar: {
            width: `calc(100% - ${drawerWidth}px)`,
            marginLeft: drawerWidth,
    },
    menuButton: {
        marginRight: 20,
    },
    drawerPaper: {
        width: drawerWidth,
    },
    content: {
        flexGrow: 1,
        padding: 20,
    },
});

export default useStyles;
